import { useAuth0 } from "@auth0/auth0-react";


const LoginButton = () => {
    const {loginWithRedirect, isAuthenticated, user } = useAuth0();

    const login = async() => {
        loginWithRedirect();

    }

    return(
        !isAuthenticated && (
            <button onClick={() => login()}>
                Sign In
            </button>
        )

    )
}

export default LoginButton
